import { Fragment } from 'react';
import { Route, Switch } from 'react-router-dom';
import Login from './auth/login/Login';

import Button from './UI/Button';
import Header from './UI/Header';

const App = () => {
  return (
    <Fragment>
      <Switch>
        <Route path='/login'>
          <Login />
        </Route>
        <Route path='*'>
          <Login />
        </Route>
      </Switch>
    </Fragment>
  );
};

export default App;
